// @ts-nocheck
import React, { useState, useEffect, useCallback, useMemo, lazy, Suspense } from 'react';
import styled from 'styled-components';
import Header from './components/Header';
import StadiumMap from './components/StadiumMap';
// Use lazy loading for components that don't need to be rendered immediately
const SeatView = lazy(() => import('./components/SeatView'));
const MiniSeatView = lazy(() => import('./components/MiniSeatView'));
import TicketForm from './components/TicketForm';
const CoordinateImporter = lazy(() => import('./components/CoordinateImporter'));
const ModelUploader = lazy(() => import('./components/ModelUploader'));
import SettingsPanel from './components/SettingsPanel';
import { ModelProvider } from './utils/ModelContext';
import { loadSeatsFromFile } from './utils/coordinateLoader';

/**
 * @typedef {Object} SeatCoordinates
 * @property {number} x - X coordinate
 * @property {number} y - Y coordinate
 * @property {number} z - Z coordinate
 */

/**
 * @typedef {Object} Seat
 * @property {string} id - Seat identifier
 * @property {string} section - Section identifier
 * @property {number} row - Row number
 * @property {number} number - Seat number
 * @property {number} price - Seat price
 * @property {SeatCoordinates} coordinates - 3D coordinates for the seat view
 */

/** @type {Seat[]} */
const DEFAULT_SEATS = [
  { 
    id: 'A1', 
    section: 'A', 
    row: 1, 
    number: 1, 
    price: 150, 
    coordinates: { x: -5, y: 2, z: 10 }
  },
  { 
    id: 'A2', 
    section: 'A', 
    row: 1, 
    number: 2, 
    price: 150, 
    coordinates: { x: -3, y: 2, z: 10 } 
  },
  { 
    id: 'B1', 
    section: 'B', 
    row: 1, 
    number: 1, 
    price: 180, 
    coordinates: { x: 5, y: 2, z: 10 } 
  },
  { 
    id: 'B2', 
    section: 'B', 
    row: 1, 
    number: 2, 
    price: 180, 
    coordinates: { x: 3, y: 2, z: 10 } 
  },
  { 
    id: 'C1', 
    section: 'C', 
    row: 5, 
    number: 1, 
    price: 100, 
    coordinates: { x: -7, y: 5, z: 15 } 
  },
  { 
    id: 'C2', 
    section: 'C', 
    row: 5, 
    number: 2, 
    price: 100, 
    coordinates: { x: 7, y: 5, z: 15 } 
  },
];

// Simple loading component for lazy-loaded components
const LazyLoadingFallback = () => (
  <LoadingContainer>
    <LoadingMessage>Loading component...</LoadingMessage>
  </LoadingContainer>
);

const App = () => {
  const [availableSeats, setAvailableSeats] = useState(DEFAULT_SEATS);
  const [selectedSeat, setSelectedSeat] = useState(null);
  const [viewingMode, setViewingMode] = useState(false);
  const [purchaseComplete, setPurchaseComplete] = useState(false);
  const [viewKey, setViewKey] = useState(0); // Add a key to force re-render
  const [showImporter, setShowImporter] = useState(false);
  const [showModelUploader, setShowModelUploader] = useState(false);
  const [isLoadingSeats, setIsLoadingSeats] = useState(false);
  const [fileSeatsLoaded, setFileSeatsLoaded] = useState(false);
  const [customModelUrl, setCustomModelUrl] = useState(null);
  const [modelLoaded, setModelLoaded] = useState(true);

  // Debounce timeout reference for state updates
  const viewUpdateTimeoutRef = React.useRef(null);

  // Load seats from coordinates.txt file when the app mounts
  useEffect(() => {
    const loadSeats = async () => {
      setIsLoadingSeats(true);
      try {
        const seats = await loadSeatsFromFile();
        if (seats && seats.length > 0) {
          setAvailableSeats(seats);
          setFileSeatsLoaded(true);
        }
      } catch (error) {
        console.error('Failed to load seats from file:', error);
      } finally {
        setIsLoadingSeats(false);
      }
    };

    loadSeats();

    // Cleanup any pending timeouts when component unmounts
    return () => {
      if (viewUpdateTimeoutRef.current) {
        clearTimeout(viewUpdateTimeoutRef.current);
      }
    };
  }, []);

  /**
   * Handle seat selection with debouncing to prevent rapid view changes
   * @param {Seat} seat - The selected seat
   */
  const handleSeatSelect = useCallback((seat) => {
    // Check if seat is valid and different from the current selection
    if (!seat) {
      console.error('Invalid seat selected');
      return;
    }

    // Log the seat being selected for debugging
    console.log('App - Selected seat:', seat.id, seat);

    // More thorough comparison to avoid false duplicates
    const isSameSeat = selectedSeat && 
                       selectedSeat.id === seat.id && 
                       selectedSeat.section === seat.section &&
                       selectedSeat.row === seat.row &&
                       selectedSeat.number === seat.number;

    if (isSameSeat) {
      console.log('Already selected seat', seat.id);
      return;
    }

    // Create a fresh seat object with a timestamped unique ID to avoid any React rendering issues
    const freshSeat = {
      ...seat,
      _uniqueTimestamp: Date.now(), // Add a timestamp to force React to recognize this as a new object
    };

    // Update selected seat 
    setSelectedSeat(freshSeat);

    // Use debounced view key update to prevent too many re-renders
    if (viewUpdateTimeoutRef.current) {
      clearTimeout(viewUpdateTimeoutRef.current);
    }

    viewUpdateTimeoutRef.current = setTimeout(() => {
      setViewKey(prevKey => prevKey + 1);
      viewUpdateTimeoutRef.current = null;
    }, 100); // 100ms debounce
  }, [selectedSeat]);

  /**
   * Toggle viewing mode between map and expanded 3D view
   */
  const handleViewToggle = useCallback(() => {
    setViewingMode(prevMode => !prevMode);

    // Use debounced view key update
    if (viewUpdateTimeoutRef.current) {
      clearTimeout(viewUpdateTimeoutRef.current);
    }

    viewUpdateTimeoutRef.current = setTimeout(() => {
      setViewKey(prevKey => prevKey + 1);
      viewUpdateTimeoutRef.current = null;
    }, 100); // 100ms debounce
  }, []);

  /**
   * Handle ticket purchase
   */
  const handlePurchase = useCallback(() => {
    if (selectedSeat) {
      setPurchaseComplete(true);
    }
  }, [selectedSeat]);

  /**
   * Reset the application state
   */
  const handleReset = useCallback(() => {
    setSelectedSeat(null);
    setViewingMode(false);
    setPurchaseComplete(false);

    // Use debounced view key update
    if (viewUpdateTimeoutRef.current) {
      clearTimeout(viewUpdateTimeoutRef.current);
    }

    viewUpdateTimeoutRef.current = setTimeout(() => {
      setViewKey(prevKey => prevKey + 1);
      viewUpdateTimeoutRef.current = null;
    }, 100); // 100ms debounce
  }, []);

  /**
   * Handle imported seat coordinates
   * @param {Array} seats - Array of seat objects generated from coordinates
   */
  const handleSeatsImported = useCallback((seats) => {
    if (seats && seats.length > 0) {
      setAvailableSeats(seats);
      setSelectedSeat(null);
      setShowImporter(false);
    }
  }, []);

  /**
   * Toggle the coordinate importer visibility
   */
  const toggleImporter = useCallback(() => {
    setShowImporter(prev => !prev);
  }, []);

  /**
   * Toggle the model uploader visibility
   */
  const toggleModelUploader = useCallback(() => {
    setShowModelUploader(prev => !prev);
  }, []);

  /**
   * Handle model upload completion
   * @param {string} blobUrl - The URL to the uploaded model
   * @param {string} fileName - The name of the uploaded file
   */
  const handleModelUploaded = useCallback((blobUrl, fileName) => {
    setCustomModelUrl(blobUrl);

    // Force refresh of 3D view components with debounce
    if (viewUpdateTimeoutRef.current) {
      clearTimeout(viewUpdateTimeoutRef.current);
    }

    viewUpdateTimeoutRef.current = setTimeout(() => {
      setViewKey(prevKey => prevKey + 1);
      viewUpdateTimeoutRef.current = null;
    }, 100); // 100ms debounce
  }, []);

  /**
   * Reset to file seats
   */
  const resetToFileSeats = useCallback(async () => {
    setIsLoadingSeats(true);
    try {
      const seats = await loadSeatsFromFile();
      if (seats && seats.length > 0) {
        setAvailableSeats(seats);
        setSelectedSeat(null);
      }
    } catch (error) {
      console.error('Failed to reload seats from file:', error);
    } finally {
      setIsLoadingSeats(false);
    }
  }, []);

  // Create a memoized settings panel with all the admin functions
  const settingsPanelElement = useMemo(() => (
    <SettingsPanel
      showImporter={showImporter}
      toggleImporter={toggleImporter}
      showModelUploader={showModelUploader}
      toggleModelUploader={toggleModelUploader}
      handleSeatsImported={handleSeatsImported}
      handleModelUploaded={handleModelUploaded}
      resetToFileSeats={resetToFileSeats}
      resetToDefaultSeats={() => setAvailableSeats(DEFAULT_SEATS)}
      resetToDefaultModel={() => {
        setCustomModelUrl(null);
        if (viewUpdateTimeoutRef.current) {
          clearTimeout(viewUpdateTimeoutRef.current);
        }

        viewUpdateTimeoutRef.current = setTimeout(() => {
          setViewKey(prevKey => prevKey + 1);
          viewUpdateTimeoutRef.current = null;
        }, 100); // 100ms debounce
      }}
      fileSeatsLoaded={fileSeatsLoaded}
      customModelUrl={customModelUrl}
    />
  ), [
    showImporter, 
    toggleImporter, 
    showModelUploader, 
    toggleModelUploader, 
    handleSeatsImported, 
    handleModelUploaded, 
    resetToFileSeats, 
    fileSeatsLoaded, 
    customModelUrl
  ]);

  // Memoize the MapView to prevent unnecessary re-renders
  const mapView = useMemo(() => (
    <StadiumMap 
      key={`stadium-map-${viewKey}`}
      seats={availableSeats} 
      selectedSeat={selectedSeat} 
      onSeatSelect={handleSeatSelect} 
    />
  ), [availableSeats, selectedSeat, handleSeatSelect, viewKey]);

  // Memoize the SeatView to prevent unnecessary re-renders when in viewing mode
  const expandedSeatView = useMemo(() => (
    <ExpandedViewContainer key={`expanded-view-${viewKey}`}>
      <ExpandedViewHeader>
        <ExpandedViewTitle>View from Seat {selectedSeat?.id}</ExpandedViewTitle>
        <CloseButton onClick={handleViewToggle}>Ã—</CloseButton>
      </ExpandedViewHeader>
      <Suspense fallback={<LazyLoadingFallback />}>
        <SeatView 
          seatCoordinates={selectedSeat?.coordinates} 
          seat={selectedSeat}
          onBack={handleViewToggle} 
        />
      </Suspense>
    </ExpandedViewContainer>
  ), [selectedSeat, handleViewToggle, viewKey]);

  // Memoize the ticket form to prevent unnecessary re-renders
  const ticketFormView = useMemo(() => (
    <TicketForm 
      key={`ticket-form-${viewKey}`}
      selectedSeat={selectedSeat} 
      onPurchase={handlePurchase} 
      viewingMode={viewingMode}
      onViewToggle={handleViewToggle}
      modelLoaded={true}
    />
  ), [selectedSeat, handlePurchase, viewingMode, handleViewToggle, viewKey]);

  // Render purchase confirmation content when purchase is completed
  const purchaseConfirmationView = useMemo(() => (
    <PurchaseConfirmation>
      <h2>Thank you for your purchase!</h2>
      <p>You have successfully purchased a ticket for seat {selectedSeat?.id}.</p>
      <p>Section: {selectedSeat?.section}, Row: {selectedSeat?.row}, Seat: {selectedSeat?.number}</p>
      <p>Price: ${selectedSeat?.price}</p>
      <Button onClick={handleReset}>Buy Another Ticket</Button>
    </PurchaseConfirmation>
  ), [selectedSeat, handleReset]);

  return (
    <ModelProvider customModelUrl={customModelUrl}>
      <AppContainer>
        <Header settingsPanel={settingsPanelElement} />
        <MainContent>
          {purchaseComplete ? (
            purchaseConfirmationView
          ) : (
            <>
              <LeftPanel>
                {isLoadingSeats ? (
                  <LoadingContainer>
                    <LoadingMessage>Loading seats from coordinates.txt file...</LoadingMessage>
                  </LoadingContainer>
                ) : viewingMode ? (
                  expandedSeatView
                ) : (
                  mapView
                )}
              </LeftPanel>
              <RightPanel>
                {ticketFormView}
              </RightPanel>
            </>
          )}
        </MainContent>
      </AppContainer>
    </ModelProvider>
  );
};

